import React from 'react';
import './projects.css';
import CustomCard from "./customCard.js";

// Imports from MUI lib
import Paper from "@mui/material/Paper";
import {Container, Grid, Typography} from "@mui/material"; // Import your styles

// Import images
import FriendOnTheRoadImg from './images/about.jpg.jpg';
import ParkingMeterImg from './images/parking_meter.jpg';

function ProjectsPage() {

    const cardData = [
        {
            id: 1,
            title: 'FRIEND ON THE ROAD',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: {FriendOnTheRoadImg},
            actionButtonLabel: 'GitHub',
            onActionButtonClick: () => alert('Share clicked'),
        },

        {
            id: 2,
            title: 'PARKING METER',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: {ParkingMeterImg},
            actionButtonLabel: 'GitHub',
            onActionButtonClick: () => alert('Share clicked'),
        },

        {
            id: 3,
            title: 'Lizard',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: '/static/images/cards/contemplative-reptile.jpg',
            actionButtonLabel: 'Share',
            onActionButtonClick: () => alert('Share clicked'),
        },

        {
            id: 4,
            title: 'Lizard',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: '/static/images/cards/contemplative-reptile.jpg',
            actionButtonLabel: 'Share',
            onActionButtonClick: () => alert('Share clicked'),
        },

        {
            id: 5,
            title: 'Lizard',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: '/static/images/cards/contemplative-reptile.jpg',
            actionButtonLabel: 'Share',
            onActionButtonClick: () => alert('Share clicked'), // Add your custom action here
        },

        {
            id: 6,
            title: 'Lizard',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: '/static/images/cards/contemplative-reptile.jpg',
            actionButtonLabel: 'Share',
            onActionButtonClick: () => alert('Share clicked'),
        },

        {
            id: 7,
            title: 'Lizard',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: '/static/images/cards/contemplative-reptile.jpg',
            actionButtonLabel: 'Share',
            onActionButtonClick: () => alert('Share clicked'),
        },

        {
            id: 8,
            title: 'Lizard',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: '/static/images/cards/contemplative-reptile.jpg',
            actionButtonLabel: 'Share',
            onActionButtonClick: () => alert('Share clicked'),
        },

        // Add more card data as needed
    ];

    return (
        <Container className="projects-container" maxWidth="lg">
            <Paper className="paperContainer" elevation={10} sx={{backgroundColor: '#e0f2f1'}}>
                <Grid container spacing={2}>
                    {cardData.map((card) => (
                        <Grid item key={card.id} className="card">
                            {/* Use your CustomCard component */}
                            <CustomCard
                                title={card.title}
                                content={card.content}
                                image={card.image}
                                actionButtonLabel={card.actionButtonLabel}
                                onActionButtonClick={card.onActionButtonClick}
                            />
                        </Grid>
                    ))}
                </Grid>
            </Paper>
        </Container>
    );
}

export default ProjectsPage;
